script: |
  super -f text -I q11432.spq | sort > q11432.out

inputs:
  - name: q11432.spq
    data: |
      SELECT DISTINCT - - 50 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + col2 * col0 + - + col0 - + - col1 = col1 / - col0 + col2;
  - name: tab1

outputs:
  - name: q11432.out
    data: |
      50
